var w = window.innerWidth,
    h = window.innerHeight,
    canvas = document.getElementById('bubble'),
    ctx = canvas.getContext('2d'),
    rate = 60,
    arc = 100,
    time,
    count,
    size = 7,
    speed = 20,
    lights = new Array,
    colors = ['#d59254', '#ffffff', '#1f2839', '#cf7693'];

canvas.setAttribute('width', w);
canvas.setAttribute('height', h);

function init(){
    time = 0;
    count = 0;
}
